import{_ as h}from"./plugin-vue_export-helper.21dcd24c.js";import{r as i,o as d,c as p,b as e,a as n,e as t,d as a}from"./app.9b6c14fa.js";const s={},o=t('<h1 id="\u7B80\u5355\u804A\u804A\u7F13\u5B58\u96EA\u5D29\u3001\u7A7F\u900F\u3001\u51FB\u7A7F" tabindex="-1"><a class="header-anchor" href="#\u7B80\u5355\u804A\u804A\u7F13\u5B58\u96EA\u5D29\u3001\u7A7F\u900F\u3001\u51FB\u7A7F" aria-hidden="true">#</a> \u7B80\u5355\u804A\u804A\u7F13\u5B58\u96EA\u5D29\u3001\u7A7F\u900F\u3001\u51FB\u7A7F</h1><p>\u5927\u5BB6\u597D\uFF0C\u6211\u662F\u4E8C\u54E5\u5440\u3002\u4F5C\u4E3A\u540E\u7AEF\u5F00\u53D1\uFF0C\u6211\u60F3\u7F13\u5B58\u662F\u5927\u5BB6\u518D\u719F\u6089\u4E0D\u8FC7\u7684\u4E1C\u897F\u4E86\u3002</p><p>\u672C\u6587\u4F1A\u4ECB\u7ECD<strong>\u51FA\u73B0\u7F13\u5B58\u96EA\u5D29\u3001\u7A7F\u900F\u548C\u51FB\u7A7F\u7684\u4E1A\u52A1\u80CC\u666F\u3001\u89E3\u51B3\u65B9\u6848\u548C\u5BF9\u4E1A\u52A1\u53EF\u9760\u6027\u5904\u7406</strong>\u3002\u4E8B\u5148\u8BF4\u660E\uFF0C\u6700\u4F73\u89E3\u51B3\u65B9\u6848\u4E00\u5B9A\u9700\u8981\u7ED3\u5408\u5B9E\u9645\u4E1A\u52A1\u8C03\u6574\uFF0C\u4E0D\u540C\u4E1A\u52A1\u7684\u5904\u7406\u4E0D\u5B8C\u5168\u76F8\u540C</p><p>\u5176\u5B9E\u6211\u5728\u7F51\u4E0A\u4E5F\u770B\u8FC7\u4E0D\u5C11\u5173\u4E8E\u7F13\u5B58\u96EA\u5D29\u3001\u7A7F\u900F\u3001\u51FB\u7A7F\u4ECB\u7ECD\uFF0C\u4E0D\u77E5\u9053\u662F\u4E0D\u662F\u5927\u5BB6\u6240\u505A\u4E1A\u52A1\u7684\u4E0D\u540C\uFF0C\u53D1\u73B0\u6709\u4E0D\u5C11\u5C0F\u4F19\u4F34\u6709\u4EE5\u4E0B\u7591\u95EE\uFF0C\u6BD4\u5982\uFF1A</p><ul><li>\u52A0\u968F\u673A\u65F6\u95F4\u8FC7\u671F\u540E\uFF0C\u5982\u679C\u8BBF\u95EE\u65F6\u95F4\u521A\u597D\u5C31\u662F\u52A0\u4E86\u968F\u673A\u65F6\u95F4\u540E\u7684\u6570\u636E\uFF0C\u8FD9\u6837\u5C82\u4E0D\u662F\u767D\u52A0\u4E86\u968F\u673A\u65F6\u95F4\uFF1F</li><li>\u70ED\u70B9\u6570\u636E\u4E0D\u8FC7\u671F\uFF0C\u90A3\u5C82\u4E0D\u662F\u6709\u8D8A\u6765\u8D8A\u591A\u7684\u810F\u6570\u636E\uFF1F</li></ul><p>\u5C31\u4EE5\u4E0A\u95EE\u9898\uFF0C\u6211\u90FD\u4F1A\u5728\u6587\u4E2D\u4E00\u4E00\u89E3\u91CA\uFF0C\u4EE5\u4E0B\u8BF4\u7684\u7F13\u5B58\u90FD\u6307 Redis\u3002</p><p>\u6211\u4E89\u53D6\u628A\u8FD9\u4E00\u9AD8\u9891\u9762\u8BD5\u9898\u8BB2\u660E\u767D\uFF0C\u5982\u679C\u5927\u5BB6\u770B\u540E\u80FD\u5728\u8FD9\u5757\u5185\u5BB9\u548C\u9762\u8BD5\u5B98\u9762\u524D\u8C08\u7B11\u98CE\u751F\uFF0C\u90A3\u4F60\u5C31\u662F\u6700\u9753\u7684\u4ED4\u3002</p><p>\u4E0B\u9762\uFF0C\u6211\u5C31\u5F00\u59CB\u8FDB\u5165\u6B63\u9898\u5566\u3002</p><h2 id="_1-\u7F13\u5B58\u96EA\u5D29" tabindex="-1"><a class="header-anchor" href="#_1-\u7F13\u5B58\u96EA\u5D29" aria-hidden="true">#</a> 1. \u7F13\u5B58\u96EA\u5D29</h2><p>\u5373\u7F13\u5B58\u540C\u4E00\u65F6\u95F4\u5927\u9762\u79EF\u7684\u5931\u6548\uFF0C\u8FD9\u4E2A\u65F6\u5019\u6765\u4E86\u4E00\u5927\u6CE2\u8BF7\u6C42\uFF0C\u90FD\u603C\u5230\u6570\u636E\u5E93\u4E0A\uFF0C\u6700\u540E\u6570\u636E\u5E93\u5904\u7406\u4E0D\u8FC7\u6765\u5D29\u4E86\u3002</p><h3 id="_1-1-\u4E1A\u52A1\u573A\u666F\u4E3E\u4F8B" tabindex="-1"><a class="header-anchor" href="#_1-1-\u4E1A\u52A1\u573A\u666F\u4E3E\u4F8B" aria-hidden="true">#</a> 1.1 \u4E1A\u52A1\u573A\u666F\u4E3E\u4F8B</h3><p>APP \u9996\u9875\u6709\u5927\u91CF\u70ED\u70B9\u6570\u636E\uFF0C\u5728\u67D0\u5927\u578B\u6D3B\u52A8\u671F\u95F4\uFF0C\u9488\u5BF9\u4E0D\u540C\u65F6\u95F4\u6BB5\u9700\u8981\u5C55\u793A\u4E0D\u540C\u7684\u9996\u9875\u6570\u636E\u3002</p><p>\u6BD4\u5982\u5728 0 \u70B9\u65F6\u9700\u8981\u66FF\u6362\u65B0\u7684\u9996\u9875\u6570\u636E\uFF0C\u6B64\u65F6\u65E7\u9996\u9875\u6570\u636E\u8FC7\u671F\uFF0C\u65B0\u9996\u9875\u6570\u636E\u521A\u5F00\u59CB\u52A0\u8F7D\u3002</p><p>\u800C 0 \u70B9\u6B63\u5728\u6709\u4E2A\u5C0F\u6D3B\u52A8\u5F00\u59CB\uFF0C\u5927\u6279\u8BF7\u6C42\u6D8C\u5165\u3002\u56E0\u4E3A\u65B0\u6570\u636E\u521A\u5F00\u59CB\u52A0\u8F7D\uFF0C\u8BF7\u6C42\u591A\u6570\u6CA1\u6709\u547D\u4E2D\u7F13\u5B58\uFF0C\u8BF7\u6C42\u5230\u4E86\u6570\u636E\u5E93\uFF0C\u6700\u540E\u5C31\u628A\u6570\u636E\u5E93\u6253\u6302\u4E86\u3002</p><h3 id="_1-2-\u89E3\u51B3\u65B9\u6848" tabindex="-1"><a class="header-anchor" href="#_1-2-\u89E3\u51B3\u65B9\u6848" aria-hidden="true">#</a> 1.2 \u89E3\u51B3\u65B9\u6848</h3><p><strong>\u518D\u5F3A\u8C03\u4E00\u4E0B\uFF0C\u6240\u8C13\u7684\u89E3\u51B3\u65B9\u6848\u662F\u9700\u8981\u6839\u636E\u5B9E\u9645\u4E1A\u52A1\u8C03\u6574\uFF0C\u4E0D\u540C\u4E1A\u52A1\u7684\u5904\u7406\u4E0D\u5B8C\u5168\u76F8\u540C</strong></p><h4 id="_1-2-1-\u65B9\u6CD5\u4E00" tabindex="-1"><a class="header-anchor" href="#_1-2-1-\u65B9\u6CD5\u4E00" aria-hidden="true">#</a> 1.2.1 \u65B9\u6CD5\u4E00</h4><p>\u5E38\u89C1\u65B9\u5F0F\u5C31\u662F\u7ED9\u8FC7\u671F\u65F6\u95F4\u52A0\u4E2A\u968F\u673A\u65F6\u95F4\u3002</p><p>\u6CE8\u610F\u8FD9\u4E2A\u968F\u673A\u65F6\u95F4\u4E0D\u662F\u51E0\u79D2\u54C8\uFF0C\u53EF\u4EE5\u957F\u8FBE\u51E0\u5206\u949F\u3002\u56E0\u4E3A\u5982\u679C\u6570\u636E\u91CF\u5F88\u5927\uFF0C\u6309\u7167\u4E0A\u8FF0\u4F8B\u5B50\uFF0C\u52A0\u4E0A Redis \u662F\u5355\u7EBF\u7A0B\u5904\u7406\u6570\u636E\u7684\u3002\u90A3\u4E48\u51E0\u79D2\u7684\u7F13\u51B2\u4E0D\u4E00\u5B9A\u80FD\u591F\u4FDD\u8BC1\u65B0\u6570\u636E\u90FD\u88AB\u52A0\u8F7D\u5B8C\u6210\u3002</p><p>\u6240\u4EE5\u8FC7\u671F\u65F6\u95F4\u5B81\u613F\u8BBE\u7F6E\u957F\u4E00\u70B9\uFF0C\u4E5F\u597D\u8FC7\u77ED\u4E00\u70B9\u3002\u53CD\u6B63\u6700\u540E\u90FD\u662F\u4F1A\u8FC7\u671F\u6389\uFF0C\u6700\u7EC8\u6548\u679C\u662F\u4E00\u6837\u7684\u3002</p><p>\u800C\u4E14\u8FC7\u671F\u65F6\u95F4\u8303\u56F4\u52A0\u5927\uFF0Ckey \u4F1A\u66F4\u52A0\u5206\u6563\uFF0C\u8FD9\u6837\u4E5F\u662F\u4E00\u5B9A\u7A0B\u5EA6\u7F29\u77ED Redis \u5728\u8FC7\u671F key \u65F6\u5019\u7684\u963B\u585E\u65F6\u95F4\u3002</p><p>\u800C\u81F3\u4E8E\u6587\u7AE0\u5F00\u5934\u8BF4\u7684\uFF1A\u300C\u5982\u679C\u8BBF\u95EE\u65F6\u95F4\u521A\u597D\u5C31\u662F\u52A0\u4E86\u968F\u673A\u65F6\u95F4\u540E\u7684\u6570\u636E\uFF0C\u8FD9\u6837\u5C82\u4E0D\u662F\u767D\u52A0\u4E86\u968F\u673A\u65F6\u95F4\u300D\u3002</p><p>\u73B0\u5728\u4F60\u7ED3\u5408\u4E0A\u4F8B\u6D3B\u52A8\u7684\u4F8B\u5B50\uFF0C\u5B83\u8FD8\u4F1A\u662F\u4E00\u4E2A\u95EE\u9898\u5417\uFF1F\u7ED3\u5408\u4E1A\u52A1\uFF0C\u4E00\u5B9A\u8981\u7ED3\u5408\u4E1A\u52A1\u3002</p><h4 id="_1-2-2-\u65B9\u6CD5\u4E8C" tabindex="-1"><a class="header-anchor" href="#_1-2-2-\u65B9\u6CD5\u4E8C" aria-hidden="true">#</a> 1.2.2 \u65B9\u6CD5\u4E8C</h4><p>\u52A0\u4E92\u65A5\u9501\uFF0C\u4F46\u8FD9\u4E2A\u65B9\u6848\u4F1A\u5BFC\u81F4\u541E\u5410\u91CF\u660E\u663E\u4E0B\u964D\u3002\u6240\u4EE5\u8FD8\u662F\u8981\u770B\u5B9E\u9645\u4E1A\u52A1\uFF0C\u50CF\u4E0A\u8FF0\u4F8B\u5B50\u5C31\u4E0D\u5408\u9002\u7528</p><h4 id="_1-2-3-\u65B9\u6CD5\u4E09" tabindex="-1"><a class="header-anchor" href="#_1-2-3-\u65B9\u6CD5\u4E09" aria-hidden="true">#</a> 1.2.3 \u65B9\u6CD5\u4E09</h4><p>\u70ED\u70B9\u6570\u636E\u4E0D\u8BBE\u7F6E\u8FC7\u671F\u3002\u4E0D\u8FC7\u671F\u7684\u8BDD\uFF0C\u6B63\u5E38\u4E1A\u52A1\u8BF7\u6C42\u81EA\u7136\u5C31\u4E0D\u4F1A\u6253\u5230\u6570\u636E\u5E93\u4E86\u3002</p><p>\u90A3\u65B0\u7684\u95EE\u9898\u53C8\u6765\u4E86\uFF0C\u4E0D\u8FC7\u671F\u6709\u810F\u6570\u636E\uFF0C\u600E\u4E48\u529E\uFF1F</p><p>\u5F88\u7B80\u5355\uFF0C\u6D3B\u52A8\u6574\u4F53\u7ED3\u675F\u540E\u518D\u5220\u9664\u561B\u3002</p><p>\u90A3\u50CF\u4E0A\u8FF0\u4F8B\u5B50\uFF0C\u53EF\u4EE5\u600E\u4E48\u5904\u7406\u5462\uFF1F\u2014\u2014 \u9009\u62E9\u65B9\u6CD5\u4E00\uFF1B\u6216\u8005\u63D0\u524D\u628A 0 \u70B9\u9700\u8981\u7684\u65B0\u6570\u636E\u52A0\u8F7D\u8FDB Redis\uFF0C\u4E0D\u5FC5\u7B49\u5230 0 \u70B9\u624D\u53BB\u52A0\u8F7D\uFF0C\u8FD9\u6837\u4E5F\u662F\u53EF\u4EE5\u7684</p><h2 id="_2-\u7F13\u5B58\u51FB\u7A7F" tabindex="-1"><a class="header-anchor" href="#_2-\u7F13\u5B58\u51FB\u7A7F" aria-hidden="true">#</a> 2. \u7F13\u5B58\u51FB\u7A7F</h2><p>\u7F13\u5B58\u51FB\u7A7F\u662F\u6307\u4E00\u4E2A\u70ED\u70B9 key \u8FC7\u671F\u6216\u88AB\u5220\u9664\u540E\uFF0C\u5BFC\u81F4\u7EBF\u4E0A\u539F\u672C\u80FD\u547D\u4E2D\u8BE5\u70ED\u70B9 key \u7684\u8BF7\u6C42\uFF0C\u77AC\u95F4\u5927\u91CF\u5730\u6253\u5230\u6570\u636E\u5E93\u4E0A\uFF0C\u6700\u7EC8\u5BFC\u81F4\u6570\u636E\u5E93\u88AB\u51FB\u57AE\u3002</p><p>\u6709\u79CD\u5343\u91CC\u4E4B\u5824\uFF0C\u6E83\u4E8E\u8681\u7A74\u7684\u611F\u89C9\u3002</p><h3 id="_2-1-\u4E1A\u52A1\u573A\u666F\u4E3E\u4F8B" tabindex="-1"><a class="header-anchor" href="#_2-1-\u4E1A\u52A1\u573A\u666F\u4E3E\u4F8B" aria-hidden="true">#</a> 2.1 \u4E1A\u52A1\u573A\u666F\u4E3E\u4F8B</h3><p>\u51FA\u73B0\u60C5\u51B5\u4E00\u822C\u662F\u8BEF\u64CD\u4F5C\uFF0C\u6BD4\u5982\u8BBE\u7F6E\u9519\u4E86\u8FC7\u671F\u65F6\u95F4\u3001\u8BEF\u5220\u9664\u5BFC\u81F4\u7684\u3002</p><blockquote><p>\u8C01\u8FD8\u6CA1\u8BEF\u64CD\u4F5C\u8FC7\u5462\uFF0C\u5220\u5E93\u8DD1\u8DEF\u4E86\u89E3\u4E00\u4E0B\u3002\u53CD\u6B63\u6211\u8BEF\u5220\u8FC7\u6D4B\u8BD5\u5E93\u7684\u6570\u636E\uFF0C\u5E78\u597D\u4EBA\u6CA1\u4E8B\uFF0C\u72D7\u5934\u4FDD\u547D\u3002</p></blockquote><h3 id="_2-2-\u89E3\u51B3\u65B9\u6848" tabindex="-1"><a class="header-anchor" href="#_2-2-\u89E3\u51B3\u65B9\u6848" aria-hidden="true">#</a> 2.2 \u89E3\u51B3\u65B9\u6848</h3><h3 id="\u65B9\u6CD5\u4E00" tabindex="-1"><a class="header-anchor" href="#\u65B9\u6CD5\u4E00" aria-hidden="true">#</a> \u65B9\u6CD5\u4E00</h3><p>\u4EE3\u7801\u95EE\u9898\uFF0C\u8BE5 review \u7684 review\u3002</p><p>\u70ED\u70B9\u6570\u636E\u5230\u5E95\u8981\u4E0D\u8981\u8FC7\u671F\uFF0C\u4EC0\u4E48\u65F6\u5019\u8FC7\u671F\u8981\u660E\u786E</p><p>\u65E2\u7136\u662F\u70ED\u70B9\u6570\u636E\uFF0C\u5927\u6982\u7387\u662F\u6838\u5FC3\u6D41\u7A0B\u3002\u90A3\u4E48\u8BE5\u4FDD\u8BC1\u7684\u6838\u5FC3\u529F\u80FD\u8FD8\u662F\u9700\u8981\u4FDD\u8BC1\u7684\uFF0C\u51CF\u5C11\u72AF\u9519\u673A\u4F1A\u3002\u4E07\u4E00\u51FA\u95EE\u9898\uFF0C\u90A3\u5C31\u662F\u7528\u6237\u7684\u4E00\u6CE2\u8F93\u51FA\u4E86\u3002</p><h3 id="\u65B9\u6CD5\u4E8C" tabindex="-1"><a class="header-anchor" href="#\u65B9\u6CD5\u4E8C" aria-hidden="true">#</a> \u65B9\u6CD5\u4E8C</h3><p>\u7EBF\u4E0A\u8BEF\u64CD\u4F5C\u7684\u4E8B\u60C5\uFF0C\u8BE5\u52A0\u5F3A\u6743\u9650\u7BA1\u7406\u7684\u52A0\u5F3A\uFF0C\u7279\u522B\u662F\u7EBF\u4E0A\u6743\u9650\uFF0C\u4E00\u5B9A\u9700\u8981\u5BA1\u6838\uFF0C\u4EE5\u9632\u624B\u6296\u3002</p><h2 id="_3-\u7F13\u5B58\u7A7F\u900F" tabindex="-1"><a class="header-anchor" href="#_3-\u7F13\u5B58\u7A7F\u900F" aria-hidden="true">#</a> 3. \u7F13\u5B58\u7A7F\u900F</h2><p>\u7F13\u5B58\u7A7F\u900F\u662F\u6307\uFF1A\u5BA2\u6237\u7AEF\u8BF7\u6C42\u7F13\u5B58\u548C\u6570\u636E\u5E93\u4E2D\u4E0D\u5B58\u5728\u7684\u6570\u636E\uFF0C\u5BFC\u81F4\u6240\u6709\u7684\u8BF7\u6C42\u90FD\u6253\u5230\u6570\u636E\u5E93\u4E0A\u3002\u5982\u679C\u8BF7\u6C42\u5F88\u591A\uFF0C\u6570\u636E\u5E93\u4F9D\u65E7\u4F1A\u6302\u5F97\u660E\u660E\u767D\u767D\u3002</p><h3 id="_3-1-\u4E1A\u52A1\u573A\u666F\u4E3E\u4F8B" tabindex="-1"><a class="header-anchor" href="#_3-1-\u4E1A\u52A1\u573A\u666F\u4E3E\u4F8B" aria-hidden="true">#</a> 3.1 \u4E1A\u52A1\u573A\u666F\u4E3E\u4F8B</h3><ul><li>\u6570\u636E\u5E93\u4E3B\u952E id \u90FD\u662F\u6B63\u6570\uFF0C\u7136\u540E\u5BA2\u6237\u7AEF\u53D1\u8D77\u4E86 <code>id = -1</code> \u7684\u67E5\u8BE2</li><li>\u4E00\u4E2A\u67E5\u8BE2\u63A5\u53E3\uFF0C\u6709\u4E00\u4E2A\u72B6\u6001\u5B57\u6BB5 status\uFF0C\u5176\u5B9E 0 \u8868\u793A\u5F00\u59CB\u30011 \u8868\u793A\u7ED3\u675F\u3002\u7ED3\u679C\u6709\u8BF7\u6C42\u4E00\u76F4\u53D1 <code>status=3</code> \u7684\u8BF7\u6C42\u8FC7\u6765</li></ul><h3 id="_3-2-\u89E3\u51B3\u65B9\u6848" tabindex="-1"><a class="header-anchor" href="#_3-2-\u89E3\u51B3\u65B9\u6848" aria-hidden="true">#</a> 3.2 \u89E3\u51B3\u65B9\u6848</h3><h4 id="_3-2-1-\u65B9\u6CD5\u4E00" tabindex="-1"><a class="header-anchor" href="#_3-2-1-\u65B9\u6CD5\u4E00" aria-hidden="true">#</a> 3.2.1 \u65B9\u6CD5\u4E00</h4><p>\u505A\u597D\u53C2\u6570\u6821\u9A8C\uFF0C\u5BF9\u4E8E\u4E0D\u5408\u7406\u7684\u53C2\u6570\u8981\u53CA\u65F6 return \u7ED3\u675F</p><p>\u8FD9\u70B9\u975E\u5E38\u91CD\u70B9\uFF0C\u505A\u4EFB\u4F55\u4E1A\u52A1\u90FD\u4E00\u6837\uFF0C\u5BF9\u4E8E\u540E\u7AEF\u6765\u8BF4\uFF0C\u8981\u6709<strong>\u4E92\u4E0D\u4FE1\u4EFB\u539F\u5219</strong>\u3002</p><p>\u7B80\u5355\u6765\u8BF4\uFF0C\u5C31\u662F\u4E0D\u8981\u4FE1\u4EFB\u6765\u81EA\u524D\u7AEF\u3001\u5BA2\u6237\u7AEF\u548C\u4E0A\u6E38\u670D\u52A1\u7684\u8BF7\u6C42\u6570\u636E\uFF0C\u8BE5\u505A\u7684\u6821\u9A8C\u8FD8\u662F\u8981\u505A\u3002</p><p>\u56E0\u4E3A\u6211\u4EEC\u6C38\u8FDC\u90FD\u4E0D\u77E5\u9053\u7528\u6237\u4F1A\u5199\u4EC0\u4E48\u5947\u5947\u602A\u602A\u7684\u6570\u636E\uFF1B\u53C8\u6216\u8005\u5373\u4F7F\u4F60\u548C\u5BF9\u63A5\u7684\u5F00\u53D1\u7EA6\u5B9A\u597D\u4E86\u8981\u600E\u4E48\u4F20\u53C2\u6570\uFF0C\u4F46\u4F60\u4FDD\u4E0D\u51C6\u4ED6\u5C31\u6CA1\u9075\u5B88\u5462\uFF1B\u9000\u4E00\u6B65\u6765\u8BF4\uFF0C\u4E07\u4E00\u63A5\u53E3\u88AB\u7834\u89E3\u5462\u3002</p><p>\u4F60\u8981\u4FDD\u62A4\u597D\u81EA\u5DF1\uFF0C\u4E0D\u7136\u5230\u65F6\u51FA\u95EE\u9898\u65F6\uFF0C\u4F60\u548C\u8001\u5927\u8BF4\uFF0C\u56E0\u4E3A\u8C01\u8C01\u4E0D\u9075\u5B88\u7EA6\u5B9A\u4F20\u53C2\u5BFC\u81F4\uFF0C\u6216\u8005\u56E0\u4E3A\u6CA1\u60F3\u5230\u7528\u6237\u4F1A\u8FD9\u4E48\u586B\uFF0C\u4F60\u770B\u770B\u4F60\u8001\u5927\u4F1A\u8FD9\u4E48\u8BF4\uFF08\u72D7\u5934.jpg\uFF09</p><h4 id="_3-2-2-\u65B9\u6CD5\u4E8C" tabindex="-1"><a class="header-anchor" href="#_3-2-2-\u65B9\u6CD5\u4E8C" aria-hidden="true">#</a> 3.2.2 \u65B9\u6CD5\u4E8C</h4><p>\u5BF9\u4E8E\u67E5\u4E0D\u5230\u6570\u636E\u7684 key\uFF0C\u4E5F\u5C06\u5176\u77ED\u6682\u7F13\u5B58\u8D77\u6765\u3002</p><p>\u6BD4\u5982 30s\u3002\u8FD9\u6837\u80FD\u907F\u514D\u5927\u91CF\u76F8\u540C\u8BF7\u6C42\u77AC\u95F4\u6253\u5230\u6570\u636E\u5E93\u4E0A\uFF0C\u51CF\u8F7B\u538B\u529B\u3002</p><p>\u4F46\u662F\u540E\u9762\u80AF\u5B9A\u8981\u53BB\u770B\u4E3A\u4EC0\u4E48\u4F1A\u6709\u8FD9\u6837\u7684\u6570\u636E\uFF0C\u4ECE\u6839\u672C\u4E0A\u89E3\u51B3\u95EE\u9898\uFF0C\u8BE5\u65B9\u6CD5\u53EA\u662F\u7F13\u89E3\u95EE\u9898\u800C\u5DF2\u3002</p><p>\u5982\u679C\u53D1\u73B0\u5C31\u662F\u67D0\u4E9B ip \u5728\u8BF7\u6C42\uFF0C\u5E76\u4E14\u8FD9\u4E9B\u6570\u636E\u975E\u6CD5\uFF0C\u90A3\u53EF\u4EE5\u5728\u7F51\u5173\u5C42\u9650\u5236\u8FD9\u4E9B ip \u8BBF\u95EE</p><h4 id="_3-2-3-\u65B9\u6CD5\u4E09" tabindex="-1"><a class="header-anchor" href="#_3-2-3-\u65B9\u6CD5\u4E09" aria-hidden="true">#</a> 3.2.3 \u65B9\u6CD5\u4E09</h4><p>\u63D0\u4F9B\u4E00\u4E2A\u80FD\u8FC5\u901F\u5224\u65AD\u8BF7\u6C42\u662F\u5426\u6709\u6548\u7684\u62E6\u622A\u673A\u5236\uFF0C\u6BD4\u5982\u5E03\u9686\u8FC7\u6EE4\u5668\uFF0CRedis \u672C\u8EAB\u5C31\u5177\u6709\u8FD9\u4E2A\u529F\u80FD\u3002</p><p>\u8BA9\u5B83\u7EF4\u62A4\u6240\u6709\u5408\u6CD5\u7684 key\uFF0C\u5982\u679C\u8BF7\u6C42\u53C2\u6570\u4E0D\u5408\u6CD5\uFF0C\u5219\u76F4\u63A5\u8FD4\u56DE\u3002\u5426\u5219\u5C31\u4ECE\u7F13\u5B58\u6216\u6570\u636E\u5E93\u4E2D\u83B7\u53D6\u3002</p><p>\u5173\u4E8E\u5E03\u9686\u8FC7\u6EE4\u5668\u53EF\u4EE5\u770B\u6211\u4E4B\u524D\u5199\u7684\u6587\u7AE0\uFF1Axxx</p><h2 id="_4-\u4E1A\u52A1\u53EF\u9760\u6027\u5904\u7406" tabindex="-1"><a class="header-anchor" href="#_4-\u4E1A\u52A1\u53EF\u9760\u6027\u5904\u7406" aria-hidden="true">#</a> 4. \u4E1A\u52A1\u53EF\u9760\u6027\u5904\u7406</h2><p>\u5982\u5F00\u5934\u6240\u8BF4\uFF0C\u7F13\u5B58\u6307 Redis\u3002</p><ul><li>\u63D0\u9AD8 Redis \u53EF\u7528\u6027\uFF1ARedis \u8981\u4E48\u7528\u96C6\u7FA4\u67B6\u6784\uFF0C\u8981\u4E48\u7528\u4E3B\u4ECE + \u54E8\u5175\u3002\u4FDD\u8BC1 Redis \u7684\u53EF\u7528\u6027\u3002</li></ul><p>\u6CA1\u6709\u54E8\u5175\u7684\u4E3B\u4ECE\u4E0D\u80FD\u81EA\u52A8\u6545\u969C\u8F6C\u79FB\uFF0C\u6240\u4EE5\u53EA\u6709\u4E3B\u4ECE\uFF0C\u4E07\u4E00\u9AD8\u5CF0\u671F\u6216\u8005\u5728\u5173\u952E\u7684\u6D3B\u52A8\u65F6\u95F4\u8282\u70B9\u6302\u4E86\u3002</p><p>\u90A3\u4E48\u7B49\u51FA\u73B0\u7EBF\u4E0A\u544A\u8B66\u3001\u5B9A\u4F4D\u95EE\u9898\u3001\u6C9F\u901A\u4FE1\u606F\u3001\u7B49\u8FD0\u7EF4\u89E3\u51B3\uFF0C\u4E00\u5957\u64CD\u4F5C\u4E0B\u6765\uFF0C\u4F30\u8BA1\u9EC4\u82B1\u83DC\u90FD\u51C9\u4E86\u3002</p><ul><li>\u51CF\u5C11\u5BF9\u7F13\u5B58\u7684\u4F9D\u8D56</li></ul><p>\u5BF9\u4E8E\u70ED\u70B9\u6570\u636E\uFF0C\u662F\u4E0D\u662F\u53EF\u4EE5\u8003\u8651\u52A0\u4E0A\u672C\u5730\u7F13\u5B58\uFF0C\u6BD4\u5982\uFF1AGuava\u3001Ehcache\uFF0C\u66F4\u7B80\u5355\u70B9\uFF0ChashMap\u3001List \u4EC0\u4E48\u4E5F\u53EF\u4EE5\u3002</p><p>\u51CF\u5C11\u5BF9 Redis \u538B\u529B\u7684\u540C\u65F6\uFF0C\u8FD8\u80FD\u63D0\u9AD8\u6027\u80FD\uFF0C\u4E00\u4E3E\u4E24\u5F97\u3002</p><ul><li>\u4E1A\u52A1\u964D\u7EA7</li></ul><p>\u4ECE\u4FDD\u62A4\u4E0B\u6E38\uFF08\u63A5\u53E3\u6216\u6570\u636E\u5E93\uFF09\u7684\u89D2\u5EA6\u8003\u8651\uFF0C\u9488\u5BF9\u5927\u6D41\u91CF\u573A\u666F\u662F\u4E0D\u662F\u53EF\u4EE5\u505A\u4E0B\u9650\u6D41\u3002\u8FD9\u6837\u5373\u4F7F\u7F13\u5B58\u5D29\u4E86\uFF0C\u4E5F\u4E0D\u81F3\u4E8E\u628A\u4E0B\u6E38\u5168\u90E8\u62D6\u57AE\u3002</p><p>\u4EE5\u53CA\u8BE5\u964D\u7EA7\u7684\u529F\u80FD\u662F\u4E0D\u662F\u53EF\u4EE5\u964D\u7EA7\uFF0C\u63D0\u524D\u5199\u597D\u964D\u7EA7\u5F00\u5173\u548C\u964D\u7EA7\u903B\u8F91\uFF0C\u5173\u952E\u65F6\u5019\u5168\u9760\u5B83\u7A33\u4F4F\u3002</p><hr>',75),c=a("\u4F5C\u8005\uFF1A\u4E03\u6DC5\uFF0C\u8F6C\u8F7D\u94FE\u63A5\uFF1A"),l={href:"https://mp.weixin.qq.com/s/juUzaf1TQYMuJFbw7Y3SXg",target:"_blank",rel:"noopener noreferrer"},_=a("https://mp.weixin.qq.com/s/juUzaf1TQYMuJFbw7Y3SXg"),u=e("p",null,[e("img",{src:"http://cdn.tobebetterjavaer.com/tobebetterjavaer/images/xingbiaogongzhonghao.png",alt:"",loading:"lazy"})],-1);function b(x,f){const r=i("ExternalLinkIcon");return d(),p("div",null,[o,e("blockquote",null,[e("p",null,[c,e("a",l,[_,n(r)])])]),u])}var k=h(s,[["render",b],["__file","xuebeng-chuantou-jichuan.html.vue"]]);export{k as default};
